import React from 'react';
import './App.css';

function App() {
  return (
      <div className="App">
        <header className="App-header">
          <h1>Bun venit la Grupa Noastră</h1>
          <p>Numele meu este [Panfil] [Ion].</p>
          <p>Sunt în grupa [CR-221].</p>
        </header>
      </div>
  );
}

export default App;
